// Navbar.js

import React from 'react';
import styled from 'styled-components';

const NavbarContainer = styled.nav`
  background-color: #FFA500;
  padding: 15px 0;
`;

const NavbarContent = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 1200px;
  margin: 0 auto;
`;

const Logo = styled.h1`
  color: white;
  margin: 0;
`;

const NavLinks = styled.ul`
  list-style: none;
  margin: 0;
  padding: 0;
  display: flex;
`;

const NavLinkItem = styled.li`
  margin-right: 20px;
`;

const NavLink = styled.a`
  text-decoration: none;
  color: white;
  font-weight: bold;
  transition: color 0.3s ease;

  &:hover {
    color: #fff;
  }
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <NavbarContent>
        <Logo>MovieSite</Logo>
        <NavLinks>
          <NavLinkItem><NavLink href="#">Home</NavLink></NavLinkItem>
          <NavLinkItem><NavLink href="#">Movies</NavLink></NavLinkItem>
          <NavLinkItem><NavLink href="#">TV Shows</NavLink></NavLinkItem>
          <NavLinkItem><NavLink href="#">Contact</NavLink></NavLinkItem>
        </NavLinks>
      </NavbarContent>
    </NavbarContainer>
  );
};

export default Navbar;
